import React from "react";
import "./Coustomer.css";
import { Link as RouterLink } from "react-router-dom";
import Slider from "react-slick";
const Coustomer = () => {
  function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "red" }}
        onClick={onClick}
      />
    );
  }

  function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "green" }}
        onClick={onClick}
      />
    );
  }

  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 2,
    slidesToScroll: 2,
    initialSlide: 0,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          infinite: true,
          dots: true,
        },
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
          initialSlide: 1,
        },
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],
  };
  return (
    <>
      <div className="coustomer" id="customer-purchase">
        <div className="container">
          <h1 className="mb-4 ">Customer Purchase</h1>

          <Slider {...settings}>
            <div>
              <div className="row">
                <div className="col-md-6 col-12">
                  <div className="coustomer-card">
                    <div className="row">
                      <div className="col-6 c-first-img">
                        <img
                          src="img/Rectangle 4.png"
                          alt="img"
                          className="img-fluid"
                        />
                      </div>
                      <div className="col-6 c-second-img">
                        <img src="img/Rectangle 5.png" alt="img" />
                      </div>
                      <div>
                        <p>Purchased by Dana in Los Angeles, CA</p>
                        <p>"swimming oasis" on a notebook</p>
                      </div>
                      <div className="button">
                        <RouterLink to="/start-generating-art">
                          Remix or Purchse
                        </RouterLink>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="col-md-6 col-12">dd</div>
              </div>
            </div>
            <div>
              <div className="row">
                <div className="col-md-6 col-12">
                  <div className="coustomer-card">
                    <div className="row">
                      <div className="col-6">
                        <img src="" alt="img" />
                      </div>
                      <div className="col-6">
                        <img src="" alt="img" />
                      </div>
                      <div>
                        <p>Purchased by Dana in Los Angeles, CA</p>
                        <p>"swimming oasis" on a notebook</p>
                      </div>
                      <div className="button">
                        <RouterLink to="/start-generating-art">
                          Remix or Purchse
                        </RouterLink>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="col-md-6 col-12">dd</div>
              </div>
            </div>
          </Slider>
        </div>
      </div>
    </>
  );
};

export default Coustomer;
